import React, { useReducer } from "react";
import TaskContext from "../task-context";
import TaskReducer from '../task-reducer';

const TaskState = props => {
  const initialState = {
    tasks: [
      {taskTitle: 'Elegir plataforma', status: true, proyectoID: 1 },
      {taskTitle: 'Elegir colores', status: false, proyectoID: 2 },
      {taskTitle: 'Elegir pago', status: false, proyectoID: 3 },
      {taskTitle: 'Elegir Hosting', status: true, proyectoID: 4 },
      {taskTitle: 'Elegir plataforma', status: true, proyectoID: 4 },
      {taskTitle: 'Elegir colores', status: false, proyectoID: 3 },
      {taskTitle: 'Elegir pago', status: false, proyectoID: 3 },
      {taskTitle: 'Elegir Hosting', status: true, proyectoID: 2 },
    ],
  }
  // Creates dispatch
  const [state,dispatch] = useReducer(TaskReducer, initialState)

  return(
    <TaskContext.Provider value={{
      tasks: state.tasks
    }}>
      {props.children}
    </TaskContext.Provider>
  )
}

export default TaskState
